import React from 'react';
import {GlobalStyled} from './style.js';

function App() {
  return (
    <div className="App">
        <ul>
          <li>1</li>
          <li>2</li>
          <li>3</li>
        </ul> 
      <GlobalStyled>
      </GlobalStyled>
    </div>
  );
}

export default App;
